//css
import './Searchbar.css'
//components
import Field from '../Field/Field'

export default function Searchbar(props) {

    return (
        <div className="Searchbar">
            <Field toggle={props.toggleType} color={props.color}/>
            <Field toggle={props.toggleType} stats={props.type}/>
            <Field toggle={props.toggleType} habitat={props.type}/>

        </div>
    )
}
